    false,nt"url": null,nt"notes": "Water levels and water quality parameters
    recorded on Pool 2B. Water-Data Report 2011 413721083124001 Pool 2B at Ottawa NWR
    LOCATION: Lat. 41u00b037'21.08"N, long 83u00b012'38.44"W, near Oak Harbor, OH.
    Ottawa County, OH on Ottawa National Wildlife Refuge. MAXIMUM SURFACE AREA: 97 acres
    PERIOD OF RECORD: Datalogger installed 2009. Regional Office data analysis starts
    2009. GAGE SITE JUNE 2009 - MAY 2011 : Sutron Monitor in communication with Esterline
    pressure transducer and YSI water quality. Instruments are powered by a 1.2 ampere
    solar panel run to a deep cycle marine battery through a Sunsaver power regulator.
    Stage is collected at 15-minute intervals. GAGE SITE MAY 2011: New logger installed
    May 20, 2011. Design Analysis 522+ in communication with Esterline pressure transducer
    and YSI water quality probe in a square metal gage house. GOES antenna in communication
    with DA 522+ DCP transmits every hour in a 10 second window at a baud rate of 300.
    Instruments are powered by a 1.2 ampere solar panel run to a deep cycle marine battery
    through a Sunsaver power regulator. Solar panel , GPS and GOES antennas are attached
    to a mast connected to the gage house. Stage is collected at 15-minute intervals.
    Weekly gage height data available online, NWS Id is OAK01. COOPERATION: USGS Great
    Lakes Science Center and Ottawa NWR",nt"license_title": "License Not Specified",nt"extras":
